import React from 'react';
import styles from './Dashboard.module.css';
import floorImage from './floor.png'; // Adjust the path based on the location of the file
import ApexCharts from 'apexcharts'
<img src={floorImage} alt="Floor plan" className={styles.floorPlanImage} />

export const FloorStatus = () => {
  return (
    <div className={styles.floorStatus}>
      <h3>Floor status</h3>
      <div className={styles.floorStats}>
      <ApexCharts></ApexCharts>
      </div>
      <div className={styles.floorStatsLegend}>
        <div className={styles.legendItem}>
          <div className={styles.completedIndicator}></div>
          <span>Completed</span>
        </div>
        <div className={styles.legendItem}>
          <div className={styles.pendingIndicator}></div>
          <span>Yet to Complete</span>
        </div>
      </div>
    </div>
  );
};
